    false,nt"url": null,nt"notes": "This narrative report for Montezuma National
    Wildlife Refuge outlines Refuge accomplishments from May through July of 1941. The
    report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, and wildfires. Resource management is outlined; topics include grazing,
    haying, and timber removal. The public relations section of the report describes
    recreational uses, Refuge visitors, fishing, hunting, and violations. Photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
